import React, { useState } from 'react';
import { useParams, Link } from 'react-router-dom';
import './ProductsList.css'; // Ensure this path is correct
import './Cart.js'; // Importing Cart.js but not needed here

const categories = {
  'biscuits-drinks-packaged-foods': [
    { name: 'Biscuits', image: 'https://www.jiomart.com/images/product/original/491553852/britannia-marie-gold-biscuits-950-g-product-images-o491553852-p491553852-1-202302260446.jpg?im=Resize=(420,420)', price: 2.50 },
    { name: 'Drinks', image: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQJNDAG9VN2wguOEBYa8s4vRVT52d27hPGfsg&s', price: 1.75 },
    { name: 'Packaged Foods', image: 'data:image/jpeg;base64,', price: 3.00 }
  ],
  'fruits-vegetables': [
    { name: 'Apples', image: 'data:image/jpeg;base64,', price: 1.00 },
    { name: 'Bananas', image: 'https://images.immediate.co.uk/production/volatile/sites/30/2017/01/Bunch-of-bananas-67e91d5.jpg?quality=90&resize=440,400', price: 0.50 },
    { name: 'Carrots', image: 'data:image/jpeg;base64,', price: 0.75 }
  ],
  'cooking-essentials': [
    { name: 'Rice', image: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRuN4Vtazzg1kk2-amNRSEGCjO23vys7QATPQ&s', price: 4.00 },
    { name: 'Oil', image: 'https://images-cdn.ubuy.co.in/654b2cf2222a4667b1323196-great-value-vegetable-oil-48-fl-oz.jpg', price: 3.50 },
    { name: 'Salt', image: 'https://www.washingtonpost.com/rf/image_1484w/2010-2019/WashingtonPost/2015/11/17/Production/LocalLiving/Images/we-salt1119.jpg?t=20170517', price: 0.25 }
  ],
  'dairy-bakery': [
    { name: 'Milk', image: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRmQQA4vq4XSs10UMwHgVwdcdyJr43rLP2dnA&s', price: 1.20 },
    { name: 'Bread', image: 'data:image/jpeg;base64,', price: 2.00 },
    { name: 'Cheese', image: 'data:image/jpeg;base64,', price: 2.50 }
  ],
  'personal-care': [
    { name: 'Shampoo', image: 'data:image/jpeg;base64,', price: 3.00 },
    { name: 'Soap', image: 'data:image/jpeg;base64,', price: 1.00 },
    { name: 'Toothpaste', image: 'data:image/jpeg;base64,', price: 1.50 }
  ],
};

function ProductList() {
  const { category } = useParams();
  const products = categories[category] || [];

  // State to keep track of quantities
  const [cart, setCart] = useState({});

  const handleAddToCart = (product) => {
    setCart((prevCart) => {
      const newCart = { ...prevCart };
      if (newCart[product.name]) {
        newCart[product.name] += 1;
      } else {
        newCart[product.name] = 1;
      }
      return newCart;
    });

    alert(`${product.name} added to cart! Current quantity: ${cart[product.name] ? cart[product.name] + 1 : 1}`);
  };

  return (
    <section className="product-list">
      <h2>{category.replace(/-/g, ' ').toUpperCase()}</h2>
      <ul>
        {products.map((product, index) => (
          <li key={index} className="product-item">
            <img src={product.image} alt={product.name} />
            <p>{product.name}</p>
            <p>Price: ${product.price.toFixed(2)}</p> {/* Display the price */}
            <button onClick={() => handleAddToCart(product)}>
              Add to Cart
            </button>
            {cart[product.name] && (
              <p>Quantity: {cart[product.name]}</p>
            )}
          </li>
        ))}
      </ul>
      <Link to="/cart-summary" state={{ cart }}>
        <button>View Cart</button>
      </Link>
    </section>
  );
}

export default ProductList;
